import React from 'react';
import '../../App.css';
import { Link } from 'react-router-dom';

class Newproducts extends React.Component {
	render() {
		return (
			<React.Fragment>
				<div className='container new-arr'>
					<div className='row'>
						<div className='col-lg-6 col-sm-10 mx-auto'>
							<div className='new-arrival-img-1'>
								<h3 className='arr-text'>New arrivals<br/>are now</h3>
								<Link to='/'>
									<button className='btn btn-arr'>Show collection</button>
								</Link>
							</div>
							{/* <img src={newArrival1} alt='image' className='new-arrival-img-1'/> */}
						</div>
						<div className='col-lg-3 col-sm-3 mx-auto'>
							<div className='new-arrival-img-2'>
								<h3 className='arr-text'>Basic t-shirt<br/>$29.99</h3>
								<Link to='/details'>
									<button className='btn btn-arr'>More details</button>
								</Link>
						</div>
							{/* <img src={newArrival2} alt='image'className='new-arrival-img-2'/> */}
						</div>
						<div className='col-lg-3 col-sm-3 mx-auto'>
							<div className='new-arrival-img-3'>
								<h3 className='arr-text'>Sale this <br/> summer</h3>
								<Link to='/sale'>
									<button className='btn btn-arr'>View all</button>
								</Link>
						</div>
							{/* <img src={newArrival3} alt='image'className='new-arrival-img'/> */}
						</div>
					</div>
				</div>
			</React.Fragment>
		)
	}
}

export default Newproducts;
